import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Table from './Table';

class App extends Component {
  render() {
    const characters = [
      {
        name: 'Charlie',
        job: 'Janitor'
      },
      {
        name: 'Mac',
        job: 'Bouncer'
      },
      {
        name: 'Dee',
        job: 'Aspiring Actress'
      },
      {
        name: 'Dennis',
        job: 'Bartender'
      },
    ];

    return (
      <Table characterData={characters}/>
    )
  }
}

export default App;
